import React, {useState, useEffect} from 'react';
// import logo from './logo.svg';
import './App.css';




function App() {

  const [load, setload ] = useState(false);

  useEffect(() => {
    setload(true)
    setTimeout(() => {
      setload(false)
    }, 2000);
  },[])
  return (
    <div className="App">
      {
        load ? (<img src="./capcorp-logo.png" title="logo" class="loading-image"/>) :
      (<header className="App-header">
        <h1>Main page</h1>
      </header>)
      }
    </div>
  );
}

export default App;
